const Container = styled.div`
  position: relative;
  padding: 16px;
  border: 1.5px solid #3E2723;
  border-radius: 4px;
  height: 100%;

  &::before {
    content: "";
    position: absolute;
    top: -8px;
    left: 6%;
    width: 88%;
    height: 5px;
    border-radius: 4px 4px 0 0;
    background-color: #3E2723;
  }
`;

